import { Text, TextInput, View } from 'react-native';
import styles from '../styles/TextBoxStyle';

const TextInputBox= () => {
  return (
    <View>
      <TextInput style={styles.tex} placeholder="Hej"></TextInput>
    </View>
  )
}
export default TextInputBox;
